import React from 'react';
import projectsData from '../DataFiles/ProjectsData';
import '../CSS/Projects.css';

function Projects() {
    return (
        <div className="ProjectBody">
            <ul className="ProjectList">
                {projectsData.map((project, index) => (
                    <li key={index} className="ProjectElement">
                        <div className="ProjectColumn">
                            <div className="ProjectHeader">
                                <h1 className='ProjectName'>{project.name}</h1>
                                <h1 className='ProjectTitle'><a href={project.githubLink} rel="noreferrer" target='_blank'>{project.title} </a></h1>
                            </div>
                            <p className='ProjectDescription'>{project.description}</p>
                        </div>
                        <div className="ProjectColumn">
                            <img className='ProjectImage' src={project.image} alt={project.title} />
                        </div>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default Projects;
